'use client'

import React, { useState } from 'react';
import { Popover, PopoverContent, PopoverTrigger } from '@/components/ui/popover';
import { craftLocations } from '@/lib/data';
import { Button } from '../ui/button';
import Link from 'next/link';

const IndiaMapSVG = () => {
    const [activeState, setActiveState] = useState(null);

    const craftsByState = craftLocations.reduce((acc, craft) => {
        acc[craft.state] = craft;
        return acc;
    }, {});
    
    const hasCraft = (stateName) => !!craftsByState[stateName];

    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 1024 1190"
            className="w-full h-full"
        >
            <style>
                {`
                .state-path {
                    fill: hsl(var(--muted));
                    stroke: hsl(var(--background));
                    stroke-width: 2;
                    transition: fill 0.3s ease;
                }
                .state-path.has-craft {
                    fill: hsl(var(--secondary));
                    cursor: pointer;
                }
                .state-path.has-craft:hover, .state-path.active {
                    fill: hsl(var(--accent));
                }
                `}
            </style>
            {Object.entries(statesPaths).map(([stateName, pathData]) => {
                const craft = craftsByState[stateName];
                const stateHasCraft = !!craft;

                const trigger = (
                    <path
                        key={stateName}
                        id={stateName}
                        d={pathData}
                        className={`state-path ${stateHasCraft ? 'has-craft' : ''} ${activeState === stateName ? 'active' : ''}`}
                        onClick={() => stateHasCraft && setActiveState(stateName)}
                    />
                );

                if (!stateHasCraft) {
                    return trigger;
                }

                return (
                    <Popover key={stateName} onOpenChange={(isOpen) => !isOpen && setActiveState(null)}>
                        <PopoverTrigger asChild>{trigger}</PopoverTrigger>
                        <PopoverContent className="w-80 bg-card">
                            <div className="grid gap-4">
                                <div className="space-y-2">
                                    <h4 className="font-medium leading-none font-headline">{craft.name}</h4>
                                    <p className="text-sm text-muted-foreground">
                                        {craft.description}
                                    </p>
                                </div>
                                {craft.artisans.length > 0 && (
                                     <Button asChild variant="default" size="sm">
                                        <Link href={`/artisans/${craft.artisans[0]}`}>View Artisan</Link>
                                     </Button>
                                )}
                            </div>
                        </PopoverContent>
                    </Popover>
                );
            })}
        </svg>
    );
};

export default IndiaMapSVG;


